import React from 'react';

import s from "./styles.module.scss";
import {ASSETS_PATH} from "@shared/config";

export const Spinner = () => {
    return (
        <div className={s.spinner}>
            <img
                className={s.spinner__img}
                src={ASSETS_PATH.SPINNER}
            />
        </div>
    );
};
